  false,\n\t\"url\": null,\n\t\"notes\": \"The National Land Cover Database 2001 tree
  canopy layer was produced through a cooperative project conducted by the Multi-Resolution
  Land Characteristics (MRLC) Consortium. The MRLC Consortium is a partnership of
  federal agencies (www.mrlc.gov), consisting of the U.S. Geological Survey (USGS),
  the National Oceanic and Atmospheric Administration (NOAA), the U.S. Environmental
  Protection Agency (EPA), the U.S. Department of Agriculture (USDA), the U.S. Forest
  Service (USFS), the National Park Service (NPS), the U.S. Fish and Wildlife Service
  (FWS), the Bureau of Land Management (BLM) and the USDA Natural Resources Conservation
  Service (NRCS). One of the primary goals of the project is to generate a current,
  consistent, seamless, and accurate National Land cover Database (NLCD) circa 2001
  for the United States at medium spatial resolution. For a detailed definition and
  discussion on MRLC and the NLCD 2001 products, refer to Homer et al. (2003) and
  http://www.mrlc.gov/mrlc2k.asp. The NLCD 2001 was created by partitioning the U.S.
  into mapping zones. A total of 66 mapping zones were delineated within the conterminous
  U.S. based on ecoregion and geographical characteristics, edge matching features
  and the size requirement of Landsat mosaics. The tree canopy layer for Idaho is
  comprised of mapping zones 08, 09, 10, 18, 21, 16, and 17 which encompass whole
  or portions of several states including the state of Idaho. Questions about the
  NLCD mapping can be directed to the NLCD 2001 land cover mapping team at the USGS/EROS,
  Sioux Falls, SD (605) 594-6151 or mrlc at usgs.gov.\",\n\t\"license_title\": null,\n\t\"extras\":
